import backgroundImageThree from "../../assets/하울사진.jpeg";
import './carousel.css'



export default function Carousel() {
    return (
        <div className="window">
	        <div className="flexbox">
                <div className="img" style={{ backgroundImage: `url(${backgroundImageOne})` }} ></div>
                <div className="img" style={{ backgroundImage: `url(${backgroundImageTwo})` }} ></div>
                <div className="img" style={{ backgroundImage: `url(${backgroundImageThree})` }} ></div>
	        </div>
        </div>
    )
}
